sources.module2.js:
import React from 'react';
import { render } from 'react-dom';

class App2 extends React.Component {

    render() {
        return (
            <div className="container">           
                    <div className="col-xs-10 col-xs-offset-1">
                        <h1>Module 2</h1>                  
                </div>
            </div>
        );
    }
}

render(<App2 />, window.document.getElementById('app2'));
